import { Container } from "react-bootstrap";
import "./Header.css";
const Header = () => {
  return (
    <>
      <div className="header-wraper">
        <Container>
          <h1>HelloAz</h1>
        </Container>
      </div>
    </>
  );
};

export default Header;
